import React from "react";
import { Form, FormGroup, Input} from "reactstrap";

const NotePage = () => {
  return (
    <Form>
      <FormGroup>
        <Input type="textarea" name="text" id="notes" placeholder="Enter Your Notes Here:" />
      </FormGroup>
    </Form>
  );
};

export default NotePage;
